import Navbar from './Navbar';

class App extends Component {
  state = {
  }

 

  render() {
    return (
        <div>
            <Navbar title="React + API"/>
            <div className="container-fluid d-flex align-items-center justify-content-center h-100">
                <div className="row d-flex justify-content-center text-center">
                    <div className="col-md-10">
                        <h2 className="display-4 text-dark pt-5 mb-2 mt-6">Welcome to the React + API Challenge Landing Page</h2>
                        
                        <a className="nav-link" href="#bio"><button type="button" class="btn btn-outline-dark">Read more</button></a>
                    </div>
                </div>
            </div>
        </div>
        
    );
  }
}

export default App;
